import { Grid } from "@mui/material";



export default function  ContactCard() {

    return(
        <Grid container display='flex'>
            <Grid item 
                sm={12}
                md={6}
            ><h1>Left CArd</h1></Grid>
            <Grid item 
                sm={12}
                md={6}
            
            ><h1>Right CArd</h1></Grid>
        </Grid>
    )

};
